import React from 'react';

class UserRegistrationForm extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            firstName: "",
            lastName: "",
            username: "",
            number: "",
            email: "",
            password: "",
            confirmPassword: ""
        };

        this.handleChange = this.handleChange.bind(this);
    }

    handleChange(e) {
        this.setState({ name: e.target.value });
    }

    handleRegistrationSubmit(commentText) {
        fetch("http://localhost:5000/registerUser", {
          credentials: 'same-origin',
          method: 'post',
          headers: { 'Content-Type': 'application/json' },
          body: JSON.stringify({ text: commentText }),
        }).then((response) => {
          if (!response.ok) throw Error(response.statusText);
          return response.json();
        }).then((data) => {
            console.log(data);
          /*this.setState((prevState) => ({
            comments: prevState.comments.concat(data),
          }));*/
        })
          .catch((error) => console.log(error));
      }

    render() {
        const {firstName, lastName, username, number, email, password, confirmPassword } = this.state;
    return (
        <div class="userRegistrationFormContainer">
            <form id="userRegistrationForm" method="POSt" action="http://localhost:5000/registerUser">
                <p class="householdHomiesHeading"><a href="google.com">Household Homies</a></p>

                <p class="createAccountHeading">Create Account</p>

                <div class="inputOption">
                    <label class="inputOptionLabel">First Name</label>
                    <input class="inputOptionInput" type="text" value={firstName} onChange={this.handleChange} id="firstname" name="firstname"/>
                </div>
                <div class="inputOption">
                    <label class="inputOptionLabel">Last Name</label>
                    <input class="inputOptionInput" type="text" value={lastName} onChange={this.handleChange} id="lastname" name="lastname"/>
                </div>
                <div class="inputOption">
                    <label class="inputOptionLabel" for="email">Phone Number</label>
                    <input class="inputOptionInput" type="text" value={number} onChange={this.handleChange} id="number" name="number"/>
                </div>
                <div class="inputOption">
                    <label class="inputOptionLabel" for="username">Username</label>
                    <input class="inputOptionInput" type="text" value={username} onChange={this.handleChange} id="username" name="username"/>
                </div>
                <div class="inputOption">
                    <label class="inputOptionLabel" for="email">Email</label>
                    <input class="inputOptionInput" type="text" value={email} onChange={this.handleChange} id="email" name="email"/>
                </div>
                <div class="inputOption">
                    <label class="inputOptionLabel" for="password">Password</label>
                    <input class="inputOptionInput" type="text" value={password} onChange={this.handleChange} id="password" name="password"/>
                </div>
                <div class="inputOption">
                    <label class="inputOptionLabel" for="password2">Confirm Password</label>
                    <input class="inputOptionInput" type="text" value={confirmPassword} onChange={this.handleChange} id="password2" name="password2"/>
                </div>

                <div id="registerButttonContainer">
                    <button id="registerButton" type="submit">Register</button>
                </div>

                <label id="existentAccountHeading">Already have an account?</label>
                <label id="existentAccountLink"><a href="google.com">Login</a></label>
            </form>
        </div>
    );
    }
}

export default UserRegistrationForm;
